  $("#manual_filterrific_filter").keypress(function( event ) {
    if(event.which == 13) {
      event.preventDefault();
      $('#manual_filterrific_filter').submit();
    }
  });

  // Use modified filterrific form submission function on manual teacher's
  // filter form so that the ajax spinner works
  $('#manual_filterrific_filter').submit(function() {
    var form = $('#manual_filterrific_filter'),
        url = form.attr("action");
    // turn on spinner
    $('.filterrific_spinner').show();
    // Submit ajax request
    $.ajax({
      url: url,
      data: form.serialize(),
      type: 'GET',
      dataType: 'script'
    }).done(function( msg ) {
      $('.filterrific_spinner').hide();
    });
    return false;
  });

  // Highlight any TeacherTest top-level blocks marked for deletion in outline
  $(document).on(
    'change',
    '.outline-block-delete-top_level input, .outline-block-delete-question_group input',
    function(){
      if($(this).prop('checked')) {
        $(this).closest(".inner").addClass("marked-for-deletion");
      } else {
        $(this).closest(".inner").removeClass("marked-for-deletion");
      };
    }
  );

  // Open a question from QB questions list in modal
  $(document).on(
    'click',
    '.questions_list .question_group .content .question, .questions_list .question_group .content .specification',
    function(){
      var self = $(this),
          question_id = self.closest('.question_group').data('question_id');
      IbQuestionbank.QuestionGroup.openModal(question_id);
    }
  );

